/* My Inside Style
   name inside.tensor.ru - accordion snow
   url  https://userstyles.org/styles/122015/inside-tensor-ru-accordion-snow
   git  https://github.com/iNovozhilov/InsideTensorUserStyle
*/

@-moz-document domain(inside.tensor.ru) {
   #howEasy, .sideBarBackground {
      background: transparent;
   }
   @keyframes snow {
      0% {
         top: -155px;
         left: 0px;
      }
      10% {
         left: -3pt;
      }
      20% {
         left: -7pt;
      }
      30% {
         left: -1pt;
      }
      40% {
         left: -4pt;
      }
      50% {
         left: -9pt;
      }
      60% {
         left: -6pt;
      }
      70% {
         left: -8pt;
      }
      80% {
         left: -2pt;
      }
      90% {
         left: -7pt;
      }
      100% {
         top: 0px;
         left: 0px;
      }
   }
   @-moz-keyframes snow {
      0% {
         top: -155px;
         left: 0px;
      }
      10% {
         left: -3pt;
      }
      20% {
         left: -7pt;
      }
      30% {
         left: -1pt;
      }
      40% {
         left: -4pt;
      }
      50% {
         left: -9pt;
      }
      60% {
         left: -6pt;
      }
      70% {
         left: -8pt;
      }
      80% {
         left: -2pt;
      }
      90% {
         left: -7pt;
      }
      100% {
         top: 0pt;
         left: 0px;
      }
   }
   @-webkit-keyframes snow {
      0% {
         top: -155px;
         left: 0px;
      }
      10% {
         left: -3pt;
      }
      20% {
         left: -7pt;
      }
      30% {
         left: -1pt;
      }
      40% {
         left: -4pt;
      }
      50% {
         left: -9pt;
      }
      60% {
         left: -6pt;
      }
      70% {
         left: -8pt;
      }
      80% {
         left: -2pt;
      }
      90% {
         left: -7pt;
      }
      100% {
         top: 0px;
         left: 0px;
      }
   }
   .sidebar:before {
      animation: snow 20s linear infinite;
      -moz-animation: snow 20s linear infinite;
      -webkit-animation: snow 20s linear infinite;
      content: '';
      bottom: 0;
      top: 0px;
      width: 210px;
      position: absolute;
      display: block;
      background-size: 150% !important;
      background-image: url('data:image/png;base64,') !important;
   }
}
